import React from 'react';
import {css} from "@emotion/css";
import img1 from "../../Assets/About/img.png"
import img2 from "../../Assets/About/img_1.png"
import img3 from "../../Assets/About/img_2.png"
import img4 from "../../Assets/About/img_3.png"


const AboutServicesSection = css`
  width: 100%;
  background: #000;
  position: relative;
  padding: 7% 0;

  .AboutServicesSectionBlock {
    width: 80%;
    position: relative;
    margin: 0 auto;
    @media (max-width: 768px){
      width: 100%;
    }
    & h1 {
      font-family: 'Circe', sans-serif;
      font-weight: 400;
      font-size: 36px;
      color: #FFFFFF;
      @media (max-width: 425px){
        font-size: 24px;
      }
    }


    &_card {
      margin-top: 20%;

      &_img {
        width: 100%;
        position: relative;
        height: 80%;
        &:before {
          //opacity: 0.6;
          opacity: 0;
          position: absolute;
          content: "";
          width: 100%;
          height: 100%;
          background: #000000;
        }

        & img {
          width: 100%;
          height: 100%;
          object-fit: cover;
        }
      }

      & h3 {
        font-family: 'Circe', sans-serif;
        font-weight: 400;
        font-size: 16px;
        color: #FFFFFF;
        margin-top: 12%;
      }
    }
  }

`
const Index = () => {
    return (
        <div className={AboutServicesSection}>
            <div className="container">
                <div className="AboutServicesSectionBlock">
                    <h1>Наши услуги</h1>
                    <div className="row">
                        <div className="col-lg-3 col-md-6  gap-4">
                            <div className="AboutServicesSectionBlock_card">
                                <div className="AboutServicesSectionBlock_card_img">
                                    <img src={img1} alt=""/>
                                </div>
                                <h3>Разработка сайтов</h3>
                            </div>
                        </div>
                        <div className="col-lg-3 col-md-6  gap-4">
                            <div className="AboutServicesSectionBlock_card">
                                <div className="AboutServicesSectionBlock_card_img">
                                    <img src={img2} alt=""/>
                                </div>
                                <h3>Продвижение в соц сетях</h3>
                            </div>
                        </div>
                        <div className="col-lg-3 col-md-6  gap-4">
                            <div className="AboutServicesSectionBlock_card">
                                <div className="AboutServicesSectionBlock_card_img">
                                    <img src={img3} alt=""/>
                                </div>
                                <h3>Маркетинговый план</h3>
                            </div>
                        </div>
                        <div className="col-lg-3 col-md-6 gap-4">
                            <div className="AboutServicesSectionBlock_card">
                                <div className="AboutServicesSectionBlock_card_img">
                                    <img src={img4} alt=""/>
                                </div>
                                <h3>Дизайн </h3>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Index;
